import React, { useState } from 'react';
import Header from "../Header";
import Footer from '../Footer';
import './style.css';


export default function Homepage() {

    /* 
    useState(): when data changes re-render the UI
    useState(0): take first argument "0" for initialising state (default)
    video =>  reactive value 
    setList => setter
    */
   const [video, setList] = useState(0, '../../../../server]')
   
    return (
        <div>
            <Header />
            <div className='hooks'>
            <p>JE SUIS DANS LA ROUTE /FILES - DANS REACT</p>
            <button onClick={() => setList(video + 1)}>
                {/* UI updates when state changes */}
                {video}
            </button>
            </div>
            <Footer />
        </div>  
    )
}
